  false,\n\t\"url\": null,\n\t\"notes\": \"Estimates of land use categories are an
  essential component for computing the water budget of the High Plains aquifer. These
  raster land-use data represent yearly estimated land use for the High Plains from
  1949 to 2008. These data were developed using the FOREcasting SCEnarios of future
  land cover (FORE-SCE) model (Sohl and others, 2007) and then processed using a Geographic
  Information System (GIS). The GIS software used to process these data was Environmental
  Systems Research Institute (ESRI, Inc.) ArcGIS Desktop 9.3.1.\",\n\t\"license_title\":
